int ObTZInfoMap::init(const lib::ObMemAttr &attr)
{
  int ret = OB_SUCCESS;
  if (OB_UNLIKELY(inited_)) {
    ret = OB_INIT_TWICE;
    LOG_WARN("init twice", K(ret));
  } else if (OB_FAIL(id_map_buf_.init(attr))) {
    LOG_WARN("fail to init id map", K(ret));
  } else if (OB_FAIL(name_map_buf_.init(attr))) {
    LOG_WARN("fail to init name map", K(ret));
  } else {
    inited_ = true;
  }
  return ret;
}

void ObTZInfoMap::destroy()
{
  id_map_ = NULL;
  name_map_ = NULL;
  id_map_buf_.destroy();
  name_map_buf_.destroy();
}

static bool print_tz_info(ObTZIDKey &key, ObTimeZoneInfoPos *tz_info)
{
  int ret = OB_SUCCESS;
  UNUSED(key);
  if (OB_ISNULL(tz_info)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("tz info is NULL", K(tz_info));
  } else {
    LOG_INFO("dump current time zone info", KPC(tz_info));
  }
  return OB_SUCCESS == ret;
}

int ObTZInfoMap::print_tz_info_map()
{
  int ret = OB_SUCCESS;
  if (OB_FAIL(id_map_->for_each(print_tz_info))) {
    LOG_WARN("fail to call for_each", K(ret));
  }
  return ret;
}

int ObTZInfoMap::get_tz_info_by_id(const int64_t tz_id, ObTimeZoneInfoPos &tz_info_by_id)
{
  int ret = OB_SUCCESS;
  ObTimeZoneInfoPos *tmp_tz_info = NULL;
  if (OB_FAIL(id_map_->get(tz_id, tmp_tz_info))) {
    LOG_WARN("fail to get tz_info_by_id, should not happened", K(tz_id), K(ret));
  } else if (OB_FAIL(tz_info_by_id.assign(*tmp_tz_info))) {
    LOG_WARN("assign time zone info pos failed", K(ret));
  } else {
    LOG_DEBUG("succ to get tz_info_by_id", K(tz_id), KPC(tmp_tz_info), K(ret));
  }
  if (NULL != tmp_tz_info) {
    id_map_->revert(tmp_tz_info);
  }
  return ret;
}

int ObTZInfoMap::get_tz_info_by_name(const ObString &tz_name, ObTimeZoneInfoPos &tz_info_by_name)
{
  int ret = OB_SUCCESS;
  ObTZNameIDInfo *name_id_info = NULL;
  if (OB_FAIL(name_map_->get(ObTZNameKey(tz_name), name_id_info))) {
    LOG_WARN("fail to get get_tz_info_by_name", K(tz_name), K(ret));
  } else if (OB_FAIL(get_tz_info_by_id(name_id_info->tz_id_, tz_info_by_name))) {
    LOG_WARN("fail to get get_tz_info_by_name", KPC(name_id_info), K(ret));
  } else {
    LOG_DEBUG("succ to get get_tz_info_by_name", K(tz_name), KPC(name_id_info), K(tz_info_by_name), K(ret));
  }

  if (OB_ENTRY_NOT_EXIST == ret) {
    ret = OB_ERR_UNKNOWN_TIME_ZONE;
  }

  if (NULL != name_id_info) {
    name_map_->revert(name_id_info);
    name_id_info = NULL;
  }

  return ret;
}

// get value pointer of id_map_, only used for updating ObTimeZoneInfoPos by ObTimeZoneInfoManager.
int ObTZInfoMap::get_tz_info_by_id(const int64_t tz_id, ObTimeZoneInfoPos *&tz_info_by_id)
{
  int ret = OB_SUCCESS;
  if (OB_NOT_NULL(tz_info_by_id)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("tz_info_by_id should be null here", K(ret));
  } else if (OB_FAIL(id_map_->get(tz_id, tz_info_by_id))) {
    LOG_WARN("fail to get tz_info_by_id, should not happened", K(tz_id), K(ret));
  }
  return ret;
}

int ObTZInfoMap::get_tz_info_by_name(const ObString &tz_name, ObTimeZoneInfoPos *&tz_info_by_name)
{
  int ret = OB_SUCCESS;
  ObTZNameIDInfo *name_id_info = NULL;
  if (OB_NOT_NULL(tz_info_by_name)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("v should be null here", K(ret));
  } else if (OB_FAIL(name_map_->get(ObTZNameKey(tz_name), name_id_info))) {
    LOG_WARN("fail to get get_tz_info_by_name", K(tz_name), K(ret));
  } else if (OB_FAIL(get_tz_info_by_id(name_id_info->tz_id_, tz_info_by_name))) {
    LOG_WARN("fail to get get_tz_info_by_name", KPC(name_id_info), K(ret));
  }
  if (OB_ENTRY_NOT_EXIST == ret) {
    ret = OB_ERR_UNKNOWN_TIME_ZONE;
  }
  if (NULL != name_id_info) {
    name_map_->revert(name_id_info);
    name_id_info = NULL;
  }

  return ret;
}

void ObTimeZoneInfoWrap::set_tz_info_map(const ObTZInfoMap *tz_info_map)
{
  tz_info_pos_.set_tz_info_map(tz_info_map);
  tz_info_offset_.set_tz_info_map(tz_info_map);
}

void ObTimeZoneInfoWrap::reset()
{
  tz_info_pos_.reset();
  tz_info_offset_.reset();
  tz_info_ = NULL;
  class_ = NONE;
  cur_version_ = 0;
  error_on_overlap_time_ = false;
}

int ObTimeZoneInfoWrap::init_time_zone(const ObString &str_val, const int64_t curr_version,
    ObTZInfoMap &tz_info_map)
{
  int ret = OB_SUCCESS;
  int32_t offset = 0;
  set_tz_info_map(&tz_info_map);
  cur_version_ = curr_version;
  int ret_more = OB_SUCCESS;

  if (OB_FAIL(ObTimeConverter::str_to_offset(str_val, offset, ret_more, true, true))) {
    if (ret != OB_ERR_UNKNOWN_TIME_ZONE) {
      LOG_WARN("fail to convert time zone", K(str_val), K(ret));
    }
  }

  if (OB_SUCC(ret)) {//set offset time zone
    tz_info_offset_.set_offset(offset);
    tz_info_ = &tz_info_offset_;
    tz_info_->set_error_on_overlap_time(error_on_overlap_time_);
    class_ = OFFSET;
  } else if (OB_ERR_UNKNOWN_TIME_ZONE == ret) {
    ObCollationType coll_type = ObCharset::get_default_collation(ObCharset::get_default_charset());
    int32_t no_sp_len = static_cast<int32_t>(ObCharset::strlen_byte_no_sp(coll_type,
                                                                          str_val.ptr(),
                                                                          str_val.length()));
    ObString tz_name(no_sp_len, str_val.ptr());
    tz_name = tz_name.trim();

    if (OB_FAIL(tz_info_map.get_tz_info_by_name(tz_name, tz_info_pos_))) {
      LOG_WARN("fail to get time zone info", K(tz_name), K(ret));
    }

    if (OB_ENTRY_NOT_EXIST == ret) {
      ret = OB_ERR_UNKNOWN_TIME_ZONE;
    } else if (OB_SUCC(ret)) {
      tz_info_ = &tz_info_pos_;
      tz_info_->set_error_on_overlap_time(error_on_overlap_time_);
      class_ = POSITION;
    }
  }
  return ret;
}

int ObTimeZoneInfoWrap::set_error_on_overlap_time(bool is_error)
{
  int ret = OB_SUCCESS;
  error_on_overlap_time_ = is_error;
  if (OB_UNLIKELY(tz_info_ != NULL)) {//在系统初次load_system_variable时，tz_info可能为负值
    tz_info_->set_error_on_overlap_time(is_error);
  }
  return ret;
}

OB_DEF_SERIALIZE(ObTimeZoneInfoWrap)
{
  int ret = OB_SUCCESS;
  if (class_ == OFFSET) {
    LST_DO_CODE(OB_UNIS_ENCODE, class_, cur_version_, error_on_overlap_time_);
    LST_DO_CODE(OB_UNIS_ENCODE, tz_info_offset_);
  } else if (class_ == POSITION) {
    LST_DO_CODE(OB_UNIS_ENCODE, class_, cur_version_, error_on_overlap_time_);
    LST_DO_CODE(OB_UNIS_ENCODE, tz_info_pos_);
  } else {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("invalid time zone info class", K(class_), KPC(this), KCSTRING(lbt()), K(ret));
  }
  LOG_DEBUG("OB_DEF_SERIALIZE", KPC(this), KCSTRING(lbt()), K(ret));
  return ret;
}

OB_DEF_DESERIALIZE(ObTimeZoneInfoWrap)
{
  int ret = OB_SUCCESS;
  LST_DO_CODE(OB_UNIS_DECODE, class_, cur_version_, error_on_overlap_time_);
  if (POSITION == class_) {
    LST_DO_CODE(OB_UNIS_DECODE, tz_info_pos_);
    tz_info_ = &tz_info_pos_;
  } else if (OFFSET == class_) {
    LST_DO_CODE(OB_UNIS_DECODE, tz_info_offset_);
    tz_info_ = &tz_info_offset_;
  } else {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("invalid time zone info class", K(class_), KPC(this), KCSTRING(lbt()), K(ret));
  }
  return ret;
}

OB_DEF_SERIALIZE_SIZE(ObTimeZoneInfoWrap)
{
  int64_t len = 0;
  LST_DO_CODE(OB_UNIS_ADD_LEN, class_, cur_version_, error_on_overlap_time_);
  if (POSITION == class_) {
    LST_DO_CODE(OB_UNIS_ADD_LEN, tz_info_pos_);
  } else if (OFFSET == class_) {
    LST_DO_CODE(OB_UNIS_ADD_LEN, tz_info_offset_);
  }
  return len;
}

int ObTimeZoneInfoWrap::deep_copy(const ObTimeZoneInfoWrap &tz_inf_wrap)
{
  int ret = OB_SUCCESS;
  if (this != &tz_inf_wrap) {
    reset();
    if (OB_FAIL(tz_info_pos_.assign(tz_inf_wrap.tz_info_pos_))) {
      LOG_WARN("fail to assign tz_info_pos_", K(tz_inf_wrap.tz_info_pos_), K(ret));
    } else if (OB_FAIL(tz_info_offset_.assign(tz_inf_wrap.tz_info_offset_))) {
      LOG_WARN("fail to assign tz_info_", K(tz_inf_wrap.tz_info_offset_), K(ret));
    } else {
      set_tz_info_map(tz_inf_wrap.tz_info_offset_.get_tz_info_map());
      class_ = tz_inf_wrap.class_;
      cur_version_ = tz_inf_wrap.cur_version_;
      error_on_overlap_time_ = tz_inf_wrap.error_on_overlap_time_;
      if (POSITION == tz_inf_wrap.class_) {
        tz_info_ = &tz_info_pos_;
      } else if (OFFSET == tz_inf_wrap.class_) {
        tz_info_ = &tz_info_offset_;
      } else {
        ret = OB_ERR_UNEXPECTED;
        LOG_WARN("invalid class", K(tz_inf_wrap), K(ret));
      }
    }
  }
  return ret;
}

